import React from "react";
import {useState} from 'react'

import Home from './Hospital/Home'
import Signup from "./Hospital/Signup";
import Search from './Hospital/Search';
import Dsignup from './Doctor/'


import {
    BrowserRouter as Router,
    Routes,
    Route,
    Navigate,
    Link
} from "react-router-dom";

export default function App(){

    return(
        <>    
           <Router>
                <Routes>

                <Route
                        exact
                        path="/"
                        element={<Home />}
                    />
                
                     <Route
                        exact
                        path="/signup"
                        element={<Signup />}
                    />
                    <Route
                        exact
                        path="/search"
                        element={<Search />}
                    />  
                    </Routes>
            </Router>
        </>
    );
};
